import React from 'react';
import thumbUp from './images/thumb-up.svg';
import thumbDown from './images/thumb-down.svg';

export default function LikeDislike(){
  return(
    <div>
      <div><img src={thumbDown}/></div>
      <div><img src={thumbUp}/></div>      
    </div>
  )  
}
